import React from 'react'
import classes from './Modal.module.css'

const Modal = (props) => {
    let child
    if (props.showModal){
        child = (
            <div className = {classes.Modal}>
                {props.children}
            </div>
        )
    }
    return {child}
}
    


export default Modal
